import React from "react";
import { Bar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

export default function Char() {
  return (
    <>
      <div className="Container">
        <Bar
          data={{
            labels: ["w", "w2", "w3", "w4", "w5"],
            datasets: [
              {
                label: "A",
                data: [12, 14, 17, 12, 15],
                backgroundColor: "red",
              },
              {
                label: "B",
                data: [12 - 2, 14 - 2, 17 - 3, 12 - 2, 15 - 10],
                backgroundColor: "yellow",
              },
            ],
          }}
          options={{
            // maintainAspectRatio: false,
            scales: {
              x: {
                grid: false,
              },
              y: {
                beginAtZero: true,
              },
            },
            plugins: {
              legend: {},
            },
          }}
        />
      </div>
    </>
  );
}
